import { Component, Vue, Prop, Watch } from "vue-property-decorator";

@Component({})
export default class Input extends Vue {
  @Prop({ default: "text" })
  public type: string;

  @Prop({ default: "" })
  public value: any;

  @Prop({ default: "" })
  public placeholder: string;

  private localValue: any;

  @Watch("value")
  watchValue(oldval: any, newval: any) {
    this.localValue = newval;
  }
}
